import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

import { useHistory } from 'react-router-dom';
import {
  user,
  logout,
  loggedoutMessage,
  getLoginMessage,
} from '../reducers/user';
import { useDispatch, useSelector } from 'react-redux';
import { SignUp } from './components/SignUp'

const SignUpCard = styled.form`
display: flex;
 align-items: center;
flex-direction: column; 
justify-content: space-between;
overflow-x: visible; 
background-color: rgba(0,0,0,0.4);
width: 70%;
border-radius: 16px;
padding: 40px; 
margin: 40px;
box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.4), 0 6px 20px 0 rgba(0, 0, 0, 0.19);

@media(min-width: 668px)and(max-width: 1024px){
  flex-direction: row;    
}  `

const USERS_URL = 'http://localhost:9001/users';

export const MembersPage = () => {
  const dispatch = useDispatch();
  const accessToken = useSelector((store) => store.user.login.accessToken);
  const userName = useSelector((store) => store.user.login.userName);
  const userId = useSelector((store) => store.user.login.userId);
  const errorMessage = useSelector((store) => store.user.login.errorMessage);
  const loginMessage = useSelector((store) => store.user.login.loginMessage);

  // const handleSecretStuff = (event) => {
  //   event.preventDefault();
  //   dispatch(getLoginMessage(userId, accessToken));
  // };

  if (accessToken) {
    return (
      <div>
        {errorMessage && <h4>Error Message : {`${errorMessage}`}</h4>}
        {loginMessage && <h4>Secret Message : {`${loginMessage}`}</h4>}
        <p>You are logged in now, {userName}</p>
        <p>{loginMessage}</p>
        <button type='submit' onClick={(e) => dispatch(logout())}>
          LOGGING OUT
        </button>
        <button type='submit' onClick={(e) => dispatch(getLoginMessage())}>
          SEE SECRET
        </button>
      </div>
    );
  } else {
    return <SignUpCard>
      <Text>Bli medlem på Yogajuristen!<br></br>
  Som medlem får du bland annat tillgång till separata filmklipp av
  yogasekvenser, meditation, andning, motivation osv. Som
  medlem kommer du även få del av olika erbjudanden från tid till
  tid.
    </Text>
      <SignUp />
    </SignUpCard>;
  }
};
